INSERT INTO `song` (`id`, `artist_id`, `disc_id`, `disc_order`, `title`, `description`, `release_time`, `year`, `price`, `price_type`, `genre`, `lyric`, `distribution_lyric`, `total_sec`, `artist_name`, `song_composer`, `lyricist`, `producer`, `label`, `isrc_code`, `radio_playable`, `is_released`, `is_deleted`, `create_time`, `modify_time`, `delete_time`) VALUES
(17899, 14509, 1946, 3, 'Runaway', '特別收錄2006年JOKER樂團於Nokia百萬音樂起義比賽冠軍曲', '2009-05-27 00:00:00', 0000, 19, 0, 4, '午後basa 不再輕鬆 有不一樣的笑容\r\n卡布奇諾上的泡沫 有些許不同\r\n\r\n黑暗之中 看見自我 有疲憊的臉孔\r\n人群之中 失去問候 好冷漠\r\n\r\n時間已失去 不停留\r\n雨過天晴 已不再有\r\n\r\nI say runaway\r\n我要離開紛擾的街\r\nFlyaway\r\n踏進無邊無際的新界線\r\n\r\nI say runaway\r\n我要飛向天的一邊\r\nRunaway\r\n尋找充滿希望的新世界\r\n\r\nI say runaway\r\n我要離開紛擾的街\r\nFlyaway\r\n\r\nI say runaway', '', 242, '', 'JOKER', '小禾', 'Johnny', 'Wannaplay muaic', 'TWF110900003', 1, 1, 0, '2009-06-15 19:21:51', '2015-03-12 13:39:37', '0000-00-00 00:00:00'),
(17900, 14509, 1946, 4, 'Fake', '真實？！謊言？！敞開心房接受你虛偽的面容', '2009-05-27 00:00:00', 0000, 19, 0, 4, '霓虹的世界 喧鬧的大街 無盡的黑夜 月光很耀眼\r\n溫暖的視線 真實的慰切 人與人之間 單純而完美\r\n單調斑馬線 穿梭人之間 炫麗的星夜 孤獨且很遙遠\r\n冰冷的感覺 虛偽的慰藉 內心已漸漸疲憊已無所謂\r\n\r\n你 的眼睛 看不到半點誠意\r\n你 一言一句 只是在逢場作戲\r\n內心的空虛 已漸漸的佔據 喘不過氣\r\n我 的心裡 有一個完美的天地\r\n單純沒心機 笑容常掛在嘴裡\r\n複雜的環境 漸漸影響人群 自私的心理\r\n\r\n有一個聲音迴盪在耳裡\r\n試著去看清現實虛偽的遊戲', '', 270, '', 'JOKER', '文森', 'Johnny', 'Wannaplay muaic', 'TWF110900004', 1, 1, 0, '2009-06-15 19:22:01', '2015-03-12 13:39:37', '0000-00-00 00:00:00'),
(17901, 14509, 1946, 5, 'Sha la la', 'Sha la la～下著雨卻把傘放在地上轉呀轉，跟著JOKER用力的往積水處跳吧！', '2009-05-27 00:00:00', 0000, 19, 0, 4, '天 漸漸亮起 提醒  收拾慵懶睡意\r\n雨 悄悄飄起 聽  點綴熱鬧的氣息\r\n海 藍色倩影 風 吹過身軀\r\n天 片片白雲 無憂無慮\r\n\r\n我 在哪裡 擺動 節奏前去\r\n\r\nsha la la 跟著我呼吸 逆著風前進\r\nsha la la 跨大步邁去 做自己\r\nsha la la 熟悉的聲音 迴盪在耳裡\r\nsha la la 有一種魔力 叫happy\r\n\r\n夜 閃爍華麗 我 低著頭不語\r\n在 銀河系裡 神秘氣息 \r\n\r\n我 在哪裡 擺動 節奏前去\r\n\r\nsha la la 跟著我呼吸 逆著風前進\r\nsha la la 跨大步邁去 做自己\r\nsha la la 熟悉的聲音 迴盪在耳裡\r\nsha la la 有一種魔力 叫happy\r\n\r\nsha la la', '', 224, '', 'JOKER', '小禾&文森', 'Johnny', 'Wannaplay muaic', 'TWF110900005', 1, 1, 0, '2009-06-15 19:22:13', '2015-03-12 13:39:37', '0000-00-00 00:00:00'),
(17902, 14509, 1946, 6, '穿越時空那一天', '過去曾有的美好，是否讓你想要穿越時空追尋那一天、那一刻的一切。', '2009-05-27 00:00:00', 0000, 19, 0, 4, '秋天 灰色的天\r\n落葉 紅色的葉\r\n\r\n公園 鞦韆搖晃不停歇\r\n轉眼 記憶都泛黃了 好遠\r\n\r\n從來都不曾忘卻 這一切\r\n穿梭時空回憶著昨天 讓我追\r\n不要讓過去瓦解 快許願\r\n保留回憶那一天的美\r\n\r\n這一切 好像從來都不曾忘卻\r\n快許願 不要讓過去瓦解\r\n讓我追 穿梭時空回憶著昨天\r\n回憶著 每天的美', '', 270, '', '小禾', '阿凱', 'Johnny', 'Wannaplay muaic', 'TWF110900006', 1, 1, 0, '2009-06-15 19:22:23', '2015-03-12 13:39:37', '0000-00-00 00:00:00'),
(17903, 14509, 1946, 7, 'Sweet', '什麼是甜蜜的愛情？ 翻天覆地的爭吵後...期待風雨過後的寧靜...風平浪靜的愛情就很甜蜜嗎？', '2009-05-27 00:00:00', 0000, 19, 0, 4, '打開了收音機  尋找熟悉頻率  \r\n心情無憂無慮  享受音樂的旋律\r\n\r\n沙發上的手機  都是你的簡訊\r\n甜蜜俏皮話語  環繞在我的腦海裡\r\n\r\n窗外是好天氣  你說想往外去\r\n想去外面透透氣  順便曬曬日光浴\r\n我說我不想去  想在家看電影 結果你一生氣  突然間下起大雨\r\n\r\n時間已不再美麗  所有話語也都不再甜蜜 \r\n\r\n童話般的綺麗  變得撲朔迷離  原本快樂的結局  已漸漸遺忘在心裡  \r\n童話中的甜蜜  就好像是無形中的一種壓力  追求自由自在的空氣  \r\n\r\n現實中的夢境  突然間被打醒  所有一切的沉默  像一大片荒涼的土地\r\n現實般的幻影  就好像是經歷過了一場風雨  期待風雨過後的寧靜  \r\n\r\n我們還有默契  靜靜的閉上眼  想起了你的臉  so sweet\r\n\r\n', '', 257, '', 'JOKER', '文森', 'Johnny', 'Wannaplay muaic', 'TWF110900007', 1, 1, 0, '2009-06-15 19:22:34', '2015-03-12 13:39:37', '0000-00-00 00:00:00'),
(17904, 14509, 1946, 8, '放手', 'JOKER樂團突破自我，想要感動所有愛過的人', '2009-05-27 00:00:00', 0000, 19, 0, 4, '現在你的藉口說完了嗎  我還再等待你的下一句話\r\n哪一些要記得  哪一些該放下  你卻叫我不要太傻\r\n感覺沒了多說也無法彌補  事實上你沒勇氣走下一步\r\n都說的很明白　已經到了岔路　彼此該用理智祝福\r\n \r\n就這樣放開手  就這樣忘了我\r\n你說的愛我都是說謊的嗎  你不確定啊\r\n就這樣放開手  就這樣離開我\r\n吻上了再見的吻下一秒鐘 是誰先得到解脫\r\n \r\n愛我不愛你都做了決定  我根本已經沒有等的力氣\r\n不想讓你看見  我哭紅的雙眼  只想走出你的世界\r\n你已經為我們安排結局  我想我可以努力配合你\r\n留下來的回憶  快樂還是痛苦  讓微笑隱藏我的無助\r\n \r\nLa La La La La ......\r\n終於我空白啦  應該有回應嗎  你期待我怎麼說\r\n \r\n就這樣放開手  謝謝你忘了我 \r\n每一句我很愛你都是謊話 你還不確定嗎\r\n就這樣放開手  謝謝你離開我\r\n吻上了再見的吻那一秒鍾  是不是得到解脫\r\n \r\nLa La La La La ......\r\n終於我空白啦  應該有回應嗎  你期待我怎麼說\r\n我以為  我會哭了  我以為我會不捨\r\n我以為  我不哭了  我以為我忘了\r\n\r\n', '', 372, '', '太陽', '太陽&強納生', 'Johnny', 'Wannaplay muaic', 'TWF110900008', 1, 1, 0, '2009-06-15 19:22:46', '2015-03-12 13:39:37', '0000-00-00 00:00:00'),
(17905, 14509, 1946, 9, '雨過天晴', '我在等待什麼? 明天的太陽依舊美麗', '2009-05-27 00:00:00', 0000, 19, 0, 4, '腦海裡出現你模糊的臉龐\r\n就像是即將下雨的天空\r\n陽光漸漸離我而去\r\n寒風卻逼近我心 擾亂了呼吸\r\n \r\n為了追尋那一段我們擁有過的美麗\r\n耗盡所有勇氣\r\n不斷的尋找你和我的記憶\r\n才發現我和你並不近\r\n \r\n這模糊的世界 已消失的身影\r\n就一直在我的身邊打轉\r\n我小小的手掌 無法 再感受你的體溫\r\n你迷濛的雙眼 我懷念的身影\r\n期待會再次出現我眼前\r\n我的等待 只是想要 雨過天晴', '', 339, '', '小禾', '太陽', 'Johnny', 'Wannaplay muaic', 'TWF110900011', 1, 1, 0, '2009-06-15 19:22:57', '2015-03-12 13:39:37', '0000-00-00 00:00:00'),
(17906, 14509, 1946, 10, '完美的句點', '誰說離別的過程必須淒美，就讓這段故事留下一個完美的句點。', '2009-05-27 00:00:00', 0000, 19, 0, 4, '眺望著天空  思緒停留\r\n遠方的那頭  是否也自由\r\n想起那時候  許下承諾\r\n甜蜜的笑容  點綴在你我心中\r\n\r\n飄散的夢 是否能找尋停留的線索\r\n想試著放手  或許就讓微風輕輕的帶走\r\n\r\n難道說離別不能快樂一點點\r\n所謂的回憶  多麼的美\r\n想起了你  依偎著我  依然那麼甜\r\n\r\n如果說再見可以微笑去面對\r\n對你的思念  不再淒美\r\n就讓這故事  充滿希望  完美的句點\r\n\r\n雨後的彩虹  黯淡了許多\r\n夜裡的星空  星星不再閃爍\r\n朝向遠方走  不再回頭\r\n疲憊的臉孔  有種說不出的哀愁\r\n\r\n', '', 312, '', 'JOKER', '小禾', 'Johnny', 'Wannaplay muaic', 'TWF110900012', 1, 1, 0, '2009-06-15 19:23:08', '2015-03-12 13:39:37', '0000-00-00 00:00:00'),
(17907, 14509, 1946, 11, 'Goodbye', 'Bye了 Sweet Honey 沒有了你 我可要更用力的飛了', '2009-05-27 00:00:00', 0000, 19, 0, 4, '緊握著你捨不得放手\r\n用盡一切填滿我心中的缺口\r\n浪漫回憶浮現腦海中\r\n盡情享受你所釋放的傷痛\r\n\r\n寫下一封沒地址的信\r\n寄往地平線另一端屬於你的世界裡\r\n寂寞咒語充斥著空氣\r\n徘徊在身邊 混亂著思緒\r\n\r\n穿越了 時空的距離\r\n陷入了 思念的陷阱\r\n擁抱了 你在我的懷裡\r\n\r\ngood bye  sweet honey \r\n仰望著天空 展開了雙翼\r\n試圖飛行\r\n\r\nFly  to the moon light\r\n赤裸的身軀 沐浴在寂寞黑夜裡\r\n\r\n', '', 263, '', 'JOKER', '阿凱', 'Johnny', 'Wannaplay muaic', 'TWF110900013', 1, 1, 0, '2009-06-15 19:23:18', '2015-03-12 13:39:37', '0000-00-00 00:00:00'),
(17908, 14509, 1946, 12, '小時候', '兒時的承諾 記錄了曾經的夢 一同寫下的記憶 一起的“小時候”', '2009-05-27 00:00:00', 0000, 19, 0, 4, '我一個人 走進回憶\r\n孤獨的心 是我的心情\r\n打開抽屜 回到過去\r\n小心翼翼 翻開日記\r\n不願錯過 紀錄的自己\r\n我想能夠 有好心情\r\n\r\n我們曾經 不夠清醒\r\n瘋狂的事 不停累積\r\n想起當時 已經過去\r\n現在的我 慢慢甦醒\r\n獨自面對 一切的問題 \r\n我已學會 不再恐懼\r\n(獨自面對一切問題 不再恐懼)\r\n\r\n想想以前我們是多麼的無憂無慮\r\n現在的你們是否知道該怎麼獨立\r\n為了生活與夢想而經歷所有的努力\r\n只想讓曾許下的承諾蔓延下去\r\n\r\n現在還好嗎  一句簡單的問候\r\n想知道你還記不記得\r\n這些承諾  哪些承諾\r\n要一起冒險嗎\r\n曾經是我們最熟悉的一句話\r\n\r\n', '', 267, '', '小禾', '太陽', 'Johnny', 'Wannaplay muaic', 'TWF110900014', 1, 1, 0, '2009-06-15 19:23:30', '2015-03-12 13:39:37', '0000-00-00 00:00:00'),
(17909, 12939, 0, 2, '黑暗角落', '', '2010-06-15 00:00:00', 0000, 0, 1, 1, '', '', 274, '', '', '', '', '', '', 0, 1, 0, '2009-06-15 21:47:18', '2015-03-12 13:39:37', '0000-00-00 00:00:00'),
(17910, 11364, 0, 1, '只忙兩個月(瞎忙一場)', '樂團一開始\r\n大家紛紛討論可以寫些什麼樣的歌\r\n\r\n像是 某人(s) 總是談短暫的戀情\r\n每一次都忙得手忙腳亂\r\n瞎忙一場...\r\n', '0000-00-00 00:00:00', 0000, 0, 2, 7, '只忙兩個月〈瞎忙一場〉\r\n\r\n我把所有心血給了你\r\n我把所有青春給了你\r\n你卻不吭一聲就離去\r\n一頭霧水慘兮兮\r\n\r\n我把你的味道鎖抽屜\r\n我把照片放進護貝機\r\n你卻拍拍屁股搭taxi\r\n我的眼淚噴出了兩滴\r\n\r\n你給的兩個月〈瞎忙瞎忙〉\r\n我只忙兩個月〈瞎忙瞎忙〉\r\n不長不短的時間\r\n連個暗示都沒有給\r\n\r\n你給的兩個月〈瞎忙瞎忙〉\r\n我只忙兩個月〈瞎忙瞎忙〉\r\n眼睜睜看著床邊\r\n還夠塞一條大棉被\r\n\r\n', '', 65, '', 'happpyanna', 'stanley', '', '', '', 0, 1, 0, '2009-06-16 00:25:55', '2015-03-12 13:39:37', '0000-00-00 00:00:00'),
(17911, 11364, 0, 2, '唱歌給你聽(王子麵當鼓版)', '因為stanley寫了很好聽的這首歌\r\n所以我就卯起來弄\r\n\r\n1. 先自彈自唱 \r\n2. 邊聽邊彈電子琴\r\n3. 沒有沙沙鈴只好用 王子麵搖\r\n4. 再弄在一起', '0000-00-00 00:00:00', 0000, 0, 2, 6, '談了一整個晚上我們漫無邊際\r\n彈了一整個晚上重複的旋律\r\n我試著找回那曾有過的熱情\r\n不會因為失去而忘了自己\r\n\r\n美麗的故事不一定有好的結局\r\n誰都無法揣測那成長的痕跡\r\n我試著寫下你堅定的表情\r\n不會因為你離去而哭泣\r\n\r\n喔喔\r\n\r\n幻想你又悄悄回到我的夢裡\r\n幻想自己還能夠談些感情\r\n我不想一個人看場電影\r\n現在只想唱歌給你聽\r\n\r\n喔喔\r\n', '', 196, '', 'stanley', 'stanley', '', '', '', 0, 1, 0, '2009-06-16 00:28:45', '2015-03-12 13:39:37', '0000-00-00 00:00:00'),
(17912, 10344, 0, 1, 'Pimpled faced punks', 'Home made demo', '0000-00-00 00:00:00', 0000, 0, 1, 10, 'back in highschool we were virgins\r\nnothing but picks and hormones\r\nstick''en stones didn''t break our bones\r\nwe were afraid nothing\r\n\r\nwe just didn''t care\r\nbecause life wasn''t fair\r\npimpled faced punks without no girlfriends\r\n\r\nsharing headphones\r\ntalking ''bout songs\r\nc''mon lets go \r\nto the rock show\r\ndreaming daydreams\r\nliving the good times\r\nas if we''ll never die\r\n\r\nstrumming my guitar\r\nthinking we''ll go far...\r\n\r\ntimes they change our dreams bygone\r\nand in the end\r\nnothing remains but those old songs\r\ntell me what the hell went wrong\r\nand so they say\r\nwe need to find where we belong', '', 268, '', 'Six', 'Adam,Six', 'Six', 'Sponge Musix', '', 0, 1, 1, '2009-06-16 03:22:36', '2014-01-16 14:39:19', '2014-01-16 14:39:19'),
(17913, 10344, 0, 2, 'Live With It', 'Home made demo', '0000-00-00 00:00:00', 0000, 0, 1, 7, 'where u wonna go now?\r\nwhere u wonna go now?\r\nplease take me with u if its alright\r\n\r\nhow to face tommorow?\r\nhow to face tommorow?\r\nwill it kill me and take all i''ve ever got?\r\n\r\nwhat doesn''t kill me only makes me stronger\r\nstanding on a bridge\r\nbehold i''m that screamer\r\nbeside that river\r\nbeneath that bloody crimson sky\r\n\r\ni cant remember when\r\nyou got in my head\r\nmakes me wanna ask\r\nwhen you`ll be back again\r\nnow the things have changed\r\nand im still the same\r\nwhats my age again?\r\ni gotta live with it\r\n\r\nnow i really can''t remeber when\r\nwhen did you get back into my head\r\nsince you will not be coming back\r\ni gotta live with it', '', 259, '', 'Six', 'Adam,Lee,Six', 'Six', 'Sponge Musix', '', 0, 1, 1, '2009-06-16 03:24:04', '2014-01-16 14:39:16', '2014-01-16 14:39:16'),
(17914, 9827, 0, 1, 'Hey Girls ( 我愛中山女中2009 )(Demo)', '我愛中山女中(高)', '0000-00-00 00:00:00', 0000, 0, 2, 2, 'Hey girls !\r\nin uniform \r\nYou make me\r\nfeel wonderful\r\n\r\nHey girls !\r\n中山女中\r\n我的心\r\n蠢蠢欲動\r\n\r\n白色的上衣\r\n黑色短裙\r\n有一種魔力\r\n無法抗拒\r\n\r\n她們的美麗\r\n無庸置疑\r\n讓我的神經\r\n(快要不行)\r\n\r\n\r\n嘿我今年虛歲都二十一\r\n卻還是一樣不長進\r\n想想這到底是甚麼原因\r\n我想大概是假裝年輕\r\n', '', 258, '', '棠棠', '棠棠', '棠棠', 'Rosewood Honey Trio Inc.', '', 0, 0, 1, '2009-06-16 03:57:48', '2013-10-07 17:14:58', '0000-00-00 00:00:00'),
