(17918, 6120, 1947, 4, '花椰菜之歌', '', '2009-06-16 00:00:00', 0000, 8, 0, 10, '', '詞曲:啊強\n\n不會放棄猴子 許多人的夢啊 \n夢中的那隻猴子 正在練吉他\n他點了點頭 看著天空 \n藍色和白色 是今天的顏色\n晚餐吃咖哩 是我的主意\n但我不吃花椰菜 真是挑剔\n如果能夠再重來一次 世界從此改變\n我會選擇吃拉麵 男人的口味\n逃吧 來自藍區的卡車司機\n星夜裡沒有一個人在沙上\n游進大海裏在水裡 和魚群一起\n逃吧 來自藍區的卡車司機\n星夜裏沒有一個人在沙上\n游進大海裏在水裏 和魚群一起\n晚餐吃咖哩 是我的主意\n但我不吃花椰菜 真是挑剔\n如果能夠再重來一次 世界從此改變\n我會選擇吃拉麵 男人的口味', 292, '', '', '', '', '', '', 1, 1, 0, '2009-06-16 13:51:13', '2015-03-12 13:39:38', '0000-00-00 00:00:00'),
