(17922, 6120, 1947, 8, '花的耳朵', '', '2009-06-16 00:00:00', 0000, 8, 0, 10, '', '花的耳朵\n\n作詞：阿強\n作曲：阿強\n\n地板上的血還沒有結晶.我的手腕血還沒有流完\n在那裡有一個人影在我的胸口.讓我充滿了困惑\n\n但我不想她離開.想要刺進自己的胸口\n讓一切變成永恆.讓我遠離一切.\n\n的生命是狗屎和屁.只有那裡開滿了花\n當花瓣隨風而去.那裡就是我的終點', 329, '', '', '', '', '', '', 1, 1, 0, '2009-06-16 14:23:11', '2015-03-12 13:39:38', '0000-00-00 00:00:00'),
