(18053, 14653, 1949, 1, '一起去旅行', '', '2007-10-01 00:00:00', 0000, 19, 0, 4, '晴朗的天  氣就該有好心情\r\n\r\n探出窗外  向陽光say morning\r\n\r\n閉上眼睛  來一個深深深呼吸\r\n\r\n睜開眼期待  Happy\r\n\r\n \r\n\r\n打開手機  全都是無聊的訊息\r\n\r\n我的球鞋  吵著要帶我去旅行  讓我們\r\n\r\n \r\n\r\nDa la la  Da la Da la  跟著我一起去旅行\r\n\r\nDa la la  張開夢的翅膀  乘著風飛行\r\n\r\nDa la la  Da la Da la  跟著我一起去旅行\r\n\r\n全世界都在我懷裡  好心情\r\n\r\n \r\n\r\n天空有朵  朵彩雲好美麗\r\n\r\n感覺就像  最愛的小熊維尼\r\n\r\n地圖上有  你留下的點點滴滴\r\n\r\n彷彿要我  跟著你的足跡\r\n\r\n \r\n\r\n打開手機  全都是無聊的訊息\r\n\r\n我的球鞋  吵著要帶我去旅行  讓我們\r\n\r\n \r\n\r\nDa la la  Da la Da la  跟著我一起去旅行\r\n\r\nDa la la  張開夢的翅膀  乘著風飛行\r\n\r\nDa la la  Da la Da la  跟著我一起去旅行\r\n\r\n忘記所有 的壞情緒\r\n\r\n \r\n\r\nDa la la  Da la Da la  跟著我一起去旅行\r\n\r\nDa la la  張開夢的翅膀  乘著風飛行\r\n\r\nDa la la  Da la Da la  跟著我一起去旅行\r\n\r\n全世界都在我懷裡  好心情', '', 224, '', 'Elesha.阿堆', '小古.Johnny', 'Johnny', 'Wannaplay muaic', 'TWD130700583', 1, 1, 0, '2009-06-17 20:34:24', '2015-03-12 13:39:42', '0000-00-00 00:00:00'),
(18054, 14653, 1949, 2, '出口', '', '2007-10-01 00:00:00', 0000, 19, 0, 4, '停止保持沉默 我想應該到了結束的時候\r\n別再問為什麼 已經沒有理由繼續往下走\r\n承認我們脆弱 一絲的觸碰在也無法承受\r\n或許還是不懂 感情總會走到盡頭的時候\r\n\r\n沒必要在挽留 也別再有藉口\r\n繼續也只不 只不過是種折磨\r\n\r\n我們都需要一個出口 也說好不要回頭\r\n就算過去像個美夢 現在也是該醒來的時候\r\n就當作是一種解脫 假裝過去沒有發生過\r\n也沒什麼好追究 誰都沒有錯\r\n\r\n握著冰冷的手早已不再殘留一絲的溫柔 \r\n\r\n試著學會接受才能讓兩個人彼此都好過\r\n還剩下些什麼 也許只剩\r\n找尋出口 停止無謂的折磨\r\n \r\n我們都需要一個出口 也說好不要回頭\r\n就算過去像個美夢 現在也是該醒來的時候\r\n就當作是一種解脫 假裝過去沒有發生過\r\n也沒什麼好追究 誰都沒有錯\r\n \r\n也許再相遇的時候 可以留下溫暖笑容\r\n你依然在我心中 的美夢\r\n\r\n我們都需要一個出口 也說好不要回頭\r\n就算過去像個美夢 現在也是該醒來的時候\r\n就當作是一種解脫 假裝過去沒有發生過\r\n也沒什麼好追究 誰都沒有錯  ', '', 285, '', '阿堆', '伊蕾莎', 'Johnny', 'Wannaplay muaic', 'TWD130700584', 1, 1, 0, '2009-06-17 20:38:16', '2015-03-12 13:39:42', '0000-00-00 00:00:00');
